import React, { Component } from 'react';

class AppointmentForm extends Component {
    // Método para lidar com a submissão do formulário
    handleSubmit = (e) => {
        e.preventDefault();
        const formEle = document.querySelector("form");
        const formData = new FormData(formEle);
        console.log("Formulário enviado", formData);

        fetch("https://script.google.com/macros/s/AKfycbw99F_zjQtTU21Jn8M-Hu32lEkhy4mB10BVGaxRK-FVHbf422sWOwz38WBfSf4Gbb_8bg/exec", {
            method: "POST",
            body: formData
        })
        .then(response => response.json())
        .then(data => {
            console.log("Resposta do servidor:", data);
            // Lógica adicional após o envio, se necessário
        })
        .catch(error => {
            console.error("Erro ao enviar o formulário:", error);
        });
    }

    render() {
        return (
            <>
                <div className="appointment-form form-wraper">
                    <h3 className="title">Solicitar Agendamento</h3>
                    <div className="form-group">
                        <select className="form-select form-control">
                            <option defaultValue>Agendamento</option>
                        </select>
                    </div>
                    <div className="form-group">
                        <select className="form-select form-control">
                            <option defaultValue>Psicóloga Edineia</option>
                        </select>
                    </div>
                    <form action="#" className="form" onSubmit={this.handleSubmit}>
                        <div className="form-group">
                            <input type="text" className="form-control" name="Name" placeholder="Seu nome" />
                            <input type="number" className="form-control" name="Phone" placeholder="Número de telefone" />
                            <input type="submit" className="btn btn-secondary btn-lg" value="Enviar"/>
                        </div>
                    </form>
                </div>
            </>
        );
    }
}

export default AppointmentForm;
